/* eslint-disable */

import React from 'react';
import Experiments from 'pages/dashboard/experiments/Experiments';
import Constants from 'Constants';
import PropTypes from 'prop-types';

const DashboardBody = ({ section }) => (
  <div>
    {
      // Switch Statement
      {
        [Constants.dashboard.sections.APPLICANTS]: <Experiments />,
        [Constants.dashboard.sections.ADMIN_COMMANDS]: <AdminCommands />,
      }[section] || <SampleBulmaTable />
    }
  </div>
);

DashboardBody.defaultProps = {
  section: '',
};
DashboardBody.propTypes = {
  section: PropTypes.string,
};

export default DashboardBody;
